#
# gpu_run_cudasatabsearch_multiquery_slurm_script.sh
#
# Usage: sbatch gpu_run_cudasatabsearch_multiquery_slurm_script.sh
#
# run cudaSaTabsearch on GPU with multiple query structures
# (so database only loaded and GPU initialized once, not once per query)
#
#

#SBATCH --job-name="multiquery_gpu_cudaSaTabsearch"
#SBATCH --time=0-01:00:00
#SBATCH --partition=debug-gpu
#SBATCH --output=multiquery_gpu_cudaSaTabsearch-%j.out
#SBATCH --error=multiquery_gpu_cudaSaTabsearch-%j.err

module load cudatoolkit


TIME=/usr/bin/time
TLOCSD=./cudaSaTabsearch
tlocsdopts="-r 1024"


echo "# Run as: " $0 $* 
echo "# at: " `date`
echo "# on: " `uname -a`

# the (compressed) tableauxdistmatrixdb-sel-gs-bib-95-1.75.sorted.ascii file 
