# http://munk.cis.unimelb.edu.au/~astivala/satabsearch/tableauxdistmatrixdb-sel-gs-bib-95-1.75.sorted.ascii.gz
# (then uncompress with gunzip)

$TIME ${TLOCSD} ${tlocsdopts}  <<EOF
